import React, { Component } from "react";
import { Button, View, Text } from "react-native";
import { ScrollView, StyleSheet, Switch, TextInput } from "react-native";
import { Cell, Section, TableView } from "react-native-tableview-simple";
import courseList from "./data/courses.json";

class Fitnessinfo extends Component {
  constructor(props) {
    super(props);
    this.state = {
      courseList: courseList,
    };
  }

  render() {
    return (
      <ScrollView>
        <TableView>
          <Section header="STANDARD" footer="A Footer">
            <Cell cellStyle="Basic" title="Basic" />
            <Cell cellStyle="RightDetail" title="RightDetail" detail="Detail" />
            <Cell cellStyle="LeftDetail" title="LeftDetail" detail="Detail" />
            <Cell
              cellStyle="Subtitle"
              title="Subtitle"
              detail="No linebreakkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkkk"
            />
            <Cell
              cellStyle="Basic"
              title="Pressable w/ accessory"
              accessory="DisclosureIndicator"
              onPress={() => console.log("Heyho!")}
            />
          </Section>
        </TableView>
      </ScrollView>
    );
  }
}

export default Fitnessinfo;

